import './ShowCounter.css';

function ShowCounter(props) {
    console.log(props)
    return (
        
        <div style={{backgroundColor:'grey'}}>
            <h2>{props.val[0]}</h2>
            <h2>{props.val[1]}</h2>
            <h2>{props.val[2]}</h2>

            <h3>{props.title}</h3>
      Counter= {props.data}
      
        </div>
    )
}



export default ShowCounter;
